'''
给你一个 m x n 的矩阵 matrix 和一个整数 k ，找出并返回矩阵内部矩形区域的不超过 k 的最大数值和。

题目数据保证总会存在一个数值和不超过 k 的矩形区域。

示例 1：
输入：matrix = [[1,0,1],[0,-2,3]], k = 2
输出：2
解释：蓝色边框圈出来的矩形区域 [[0, 1], [-2, 3]] 的数值和是 2，且 2 是不超过 k 的最大数字（k = 2）。

示例 2：
输入：matrix = [[2,2,-1]], k = 3
输出：3

提示：
m == matrix.length
n == matrix[i].length
1 <= m, n <= 100
-100 <= matrix[i][j] <= 100
-105 <= k <= 105
'''
from leetcode.tools.sortedcontainers import SortedList
class Solution:
    '''
    计算[top, bottom]之间每列的和，然后使用有序集合
    '''
    def maxSumSubmatrix(self, matrix, k: int) -> int:
        ret = float("-inf")
        for top in range(len(matrix)):
            rem = matrix[top]
            for bottom in range(top + 1, len(matrix) + 1):
                if bottom != top + 1:
                    for i in range(len(matrix[0])):
                        rem[i] += matrix[bottom - 1][i]
                totalSet = SortedList([0])
                s = 0
                for v in rem:
                    s += v
                    lb = totalSet.bisect_left(s - k)
                    if lb != len(totalSet):
                        ret = max(ret, s - totalSet[lb])
                    totalSet.add(s)
        return ret
